import Navbar from "./components/Navbar";
import React, { useState } from "react";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import LoadingBar from "react-top-loading-bar";
import Content from "./components/Content";
import Login from "./components/Login";
import Signup from "./components/Signup";
import About from "./components/About";
import NoteState from './context/notes/NoteState';
import End from "./components/End";
import Main from "./components/Main";
import './App.css';
import Footer from "./components/Footer";
import Footer2 from "./components/Footer2";
import Otp from "./components/Otp";
import axios from 'axios';

function App() {
  document.body.style.background="linear-gradient(#E2EAF4,#E2EAF4,white)";
  document.body.style.backgroundRepeat='no-repeat';
  const [progress, setprogress] = useState(0);
  const showalert = () => {
    setTimeout(() => {
      setprogress(20);
    }, 100);
    setTimeout(() => {
      setprogress(40);
    }, 200);
    setTimeout(() => {
      setprogress(60);
    }, 300);
    setTimeout(() => {
      setprogress(80);
    }, 400);
    setTimeout(() => {
      setprogress(100);
    }, 500);
  };
  const handleonClick2 = () => {
    showalert();
  };

  const [email, setEmail] = useState('');
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');

  const forotp = async (e) => {
    e.preventDefault();

    try {
      // Make an API call to the backend to send OTP to the provided email
      const response = await axios.post('http://localhost:5000/send-otp', { email });
      localStorage.setItem("sentotp","otp");
      setMessage('OTP has been sent to your email!');
      setError('');
    } catch (err) {
      setMessage('');
      setError('Error sending OTP. Please try again.');
    }
  };


  const router = createBrowserRouter([
    {
      path: "/",
      element: (
        <>
          <Navbar showalert={showalert} handleonClick2={handleonClick2} />
          <LoadingBar color="#000" progress={progress} />
          <Main/><Footer2/>
        </>
      ),
    },
    {
      path: "/home",
      element: (
        <>
          <Navbar showalert={showalert} handleonClick2={handleonClick2} />
          <LoadingBar color="#000" progress={progress} />
          <div className="container"><Content handleonClick2={handleonClick2}/></div><Footer2/>
        </>
      ),
    },
    {
      path: "/about",
      element: (
        <>
          <Navbar showalert={showalert} handleonClick2={handleonClick2} />
          <LoadingBar color="#000" progress={progress} />
          <About/><Footer/>
        </>
      ),
    },
    {
      path: "/login",
      element: (
        <>
          <Navbar showalert={showalert} handleonClick2={handleonClick2} />
          <LoadingBar color="#000" progress={progress} />
          <Login showalert={showalert} handleonClick2={handleonClick2}/><Footer2/>
        </>
      ),
    },
    {
      path: "/otp",
      element: (
        <>
          <Navbar showalert={showalert} handleonClick2={handleonClick2} />
          <LoadingBar color="#000" progress={progress} />
          <Otp showalert={showalert} forotp={forotp} /><Footer/>
        </>
      ),
    },
    {
      path: "/signup",
      element: (
        <>
          <Navbar showalert={showalert} handleonClick2={handleonClick2} />
          <LoadingBar color="#000" progress={progress} />
          <div className='container'><Signup showalert={showalert} handleonClick2={handleonClick2} handleSubmit={handleSubmit}/></div><Footer2/>
        </>
      ),
    },
    {
      path: "/end",
      element: (
        <>
          <Navbar showalert={showalert} handleonClick2={handleonClick2} />
          <LoadingBar color="#000" progress={progress} />
          <div className='container'><End showalert={showalert} handleonClick2={handleonClick2}/></div><Footer2/>
        </>
      ),
    },
  ]);
  return (
    <>
    <NoteState>
    <RouterProvider router={router}/>
    </NoteState>
    </>
  )
}
export default App;
